import React from "react";
import styles from "./styles.module.css";
import { useFormik } from "formik";
import * as Yup from "yup";

const RegisterPage = () => {
    const formik = useFormik({
        initialValues: {
            firstName: "",
            email: "",
            mobile: "",
            password: "",
        },
        validationSchema: Yup.object({
            firstName: Yup.string().required("First name is required"),
            email: Yup.string()
                .email("Invalid email format")
                .required("Email is required"),
            mobile: Yup.string().required("Mobile is required"),
            password: Yup.string()
                .required("Password is required")
                .min(6, "Password must be at least 6 characters"),
        }),
        onSubmit: (values) => console.log(values),
        validateOnMount: true,
    });

    return (
        <div className="container mt-5">
            <div className="row justify-content-center">
                <div className="col-md-6">
                    <div className={`${styles.wrapper} card p-4 shadow-sm rounded-3`}>
                        <h1 className="text-center">{formik.values.firstName}</h1>
                        <h2 className="text-center">Register</h2>
                        <form onSubmit={formik.handleSubmit}>
                            <div className="mb-3">
                                <label className="form-label">First Name</label>
                                <input
                                    type="text"
                                    className={`form-control ${formik.touched.firstName && formik.errors.firstName ? "is-invalid" : ""}`}
                                    name="firstName"
                                    {...formik.getFieldProps("firstName")}
                                />
                                {formik.touched.firstName && formik.errors.firstName && (
                                    <div className="invalid-feedback">{formik.errors.firstName}</div>
                                )}
                            </div>

                            <div className="mb-3">
                                <label className="form-label">Email</label>
                                <input
                                    type="email"
                                    className={`form-control ${formik.touched.email && formik.errors.email ? "is-invalid" : ""}`}
                                    name="email"
                                    {...formik.getFieldProps("email")}
                                />
                                {formik.touched.email && formik.errors.email && (
                                    <div className="invalid-feedback">{formik.errors.email}</div>
                                )}
                            </div>

                            <div className="mb-3">
                                <label className="form-label">Mobile</label>
                                <input
                                    type="text"
                                    className={`form-control ${formik.touched.mobile && formik.errors.mobile ? "is-invalid" : ""}`}
                                    name="mobile"
                                    {...formik.getFieldProps("mobile")}
                                />
                                {formik.touched.mobile && formik.errors.mobile && (
                                    <div className="invalid-feedback">{formik.errors.mobile}</div>
                                )}
                            </div>

                            <div className="mb-3">
                                <label className="form-label">Password</label>
                                <input
                                    type="password"
                                    className={`form-control ${formik.touched.password && formik.errors.password ? "is-invalid" : ""}`}
                                    name="password"
                                    {...formik.getFieldProps("password")}
                                />
                                {formik.touched.password && formik.errors.password && (
                                    <div className="invalid-feedback">{formik.errors.password}</div>
                                )}
                            </div>

                            <button
                                type="submit"
                                className="btn btn-primary w-100"
                                disabled={!formik.isValid}
                            >
                                Register
                            </button>
                        </form>

                        <p className="text-center mt-3">
                            Already Registered? <a href="/">Click Here</a>
                        </p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default RegisterPage;
